export const getMovies = async () => {
    const response = await  fetch(
      `https://api.themoviedb.org/3/discover/movie?api_key=b1b05c658c37bb811188a82173f3c70e&language=en-US&include_adult=false&page=1`
    )
    return response.json()
  };
